window.bookSummaryJSON = "<p><b>Contains books one, two and three of the action-packed space opera Ascension series. </b></p> <p>They’ve been watching us for hundreds of years. Now they need our help. Earth is not safe. </p> <p>Zack is good at finding things, but when he discovers a global conspiracy, life as he knows it is over. Sometimes, the truth doesn’t set you free. It traps you instead. </p> <p>Kept secret for 60 years, the discovery of an alien signal forces an unlikely team to investigate a mysterious structure discovered in the furthest reaches of the solar system. </p> <p>Join the crew of the <i>Athena</i>, Earth’s most advanced spaceship on the ultimate journey beyond our wildest imagining. </p>"; 
